config:
  algo:
    T: 0
    backbone: hf_dit
    causal_attention: false
    clip_search_delta: 0.05
    clip_search_widths: []
    cross_attn: true
    dropout: 0.0
    fix_clipping: false
    ignore_bos: true
    mdlm_loss_scale: false
    name: bd3lm
    parameterization: subs
    sampler: semi_ar
    time_conditioning: false
    var_min: true
  block_size: 4
  callbacks:
    checkpoint_every_n_steps:
      _target_: lightning.pytorch.callbacks.ModelCheckpoint
      auto_insert_metric_name: false
      dirpath: /workspace/bd3lms/outputs/openwebtext-train/2025.05.16/073608/checkpoints
      every_n_train_steps: 500
      save_last: true
      save_top_k: -1
      verbose: true
    checkpoint_monitor:
      _target_: lightning.pytorch.callbacks.ModelCheckpoint
      auto_insert_metric_name: false
      dirpath: /workspace/bd3lms/outputs/openwebtext-train/2025.05.16/073608/checkpoints
      filename: best
      mode: min
      monitor: val/nll
      save_last: false
      save_top_k: 1
      verbose: true
    learning_rate_monitor:
      _target_: lightning.pytorch.callbacks.LearningRateMonitor
      logging_interval: step
  checkpointing:
    resume_ckpt_path: /workspace/bd3lms/outputs/openwebtext-train/2025.05.16/073608/checkpoints/last.ckpt
    resume_from_ckpt: true
    save_dir: /workspace/bd3lms/outputs/openwebtext-train/2025.05.16/073608
  data:
    cache_dir: /share/kuleshov/ssahoo/textdiffusion/data
    insert_train_eos: true
    insert_train_special: true
    insert_valid_eos: true
    insert_valid_special: false
    streaming: false
    tokenizer_name_or_path: gpt2
    train: openwebtext-train
    valid: openwebtext-valid
    wrap: true
  diffusion: absorbing_state
  eval:
    checkpoint_path: kuleshov-group/bd3lm-owt-block_size4
    compute_perplexity_on_sanity: false
    disable_ema: false
    gen_ppl_eval_model_name_or_path: gpt2-large
    generate_samples: false
    perplexity_batch_size: 8
  loader:
    batch_size: 512
    eval_batch_size: 16
    eval_global_batch_size: 512
    global_batch_size: 512
    num_workers: 128
    pin_memory: true
  lr_scheduler:
    _target_: transformers.get_constant_schedule_with_warmup
    num_warmup_steps: 2500
  mode: ppl_eval
  model:
    adaln: false
    attn_backend: flex
    cond_dim: 128
    dropout: 0.1
    hidden_size: 768
    length: 1024
    n_blocks: 12
    n_heads: 12
    name: small
    scale_by_sigma: true
    tie_word_embeddings: true
    type: ddit
  noise:
    sigma_max: 20
    sigma_min: 0.0001
    type: loglinear
  optim:
    beta1: 0.9
    beta2: 0.999
    eps: 1.0e-08
    lr: 0.0003
    weight_decay: 0
  sampling:
    first_hitting: true
    kv_cache: false
    logdir: ./samples_bd3lm_len1024_blocksize4
    noise_removal: false
    nucleus_p: 1.0
    num_sample_batches: 1
    var_length: false
  seed: 1
  strategy:
    _target_: lightning.pytorch.strategies.DDPStrategy
    find_unused_parameters: false
  trainer:
    _target_: lightning.Trainer
    accelerator: cuda
    accumulate_grad_batches: 1
    devices: 1
    gradient_clip_val: 1.0
    limit_train_batches: 1.0
    limit_val_batches: 1.0
    log_every_n_steps: 1000
    max_steps: 1000000
    num_nodes: 1
    num_sanity_val_steps: 2
    precision: bf16
    val_check_interval: 10000
  training:
    antithetic_sampling: true
    coeff_clip: -1.0
    ema: 0.9999
    eval_nll: true
    from_pretrained: null
    resample: false
    sampling_eps: 0.001
    sampling_eps_max: 1.0
    sampling_eps_min: 0.001
  wandb: null
